import math

def norm(lst: list):
    result = 0.0
    for i in range(len(lst)):
        result = result + lst[i] * lst[i]
    return math.sqrt(result)

def distance(lst: list, lst2: list):
    new_list = []
    if (len(lst)==len(lst2)):
        for i in range(len(lst)):
            new_list.append(lst[i]-lst2[i])
        return norm(new_list)
    else:
        return None
            


